import React from 'react';
import './MyButton.css'; // Import CSS file for styling

function MyButton() {
    return (
        <div className="index-content">
            <h4>โปรดกรอกข้อมูลตามความเป็นจริง</h4>
            <div class="labelainput">
              <label htmlFor="fullname" className="left-align">ชื่อ-สกุล:</label>
              <input type="text" id="fullname" name="fullname"/><br/>

              <label htmlFor="student_id" className="left-align">รหัสนักศึกษา:</label>
              <input type="text" id="student_id" name="student_id"/><br/>

              <label htmlFor="year" className="left-align">ชั้นปี:</label>
              <input type="text" id="year" name="year"/><br/>

              <label htmlFor="department" className="left-align">ภาควิชา:</label>
              <input type="text" id="department" name="department"/><br/>

              <label htmlFor="major" className="left-align">สาขาวิชา:</label>
              <input type="text" id="major" name="major"/><br/>
            </div>
        </div>
    );
}

export default MyButton;
